class Solution {
    public String[] replace(String[] arr) {
        if (arr == null || arr.length <= 0) return new String[0];

        int len = arr.length;
        for (int i = len - 1; i >= 0; --i) {
            if (arr[i].equals("h")) {
                for (int j = i + 1; j < len &&!arr[j].equals("h"); ++j) {
                    arr[j] = "h";
                }
            }
        }

        return arr;
    }
}

