class Solution {
    public String[] replace(String[] arr) {
        if (arr == null || arr.length <= 0) return new String[0];

        Stack<Integer> stack = new Stack<>();
        for (int i = 0; i < arr.length; ++i) {
            if (!stack.isEmpty() && arr[stack.peek()]!= arr[i]) {
                while (!stack.isEmpty()) {
                    arr[stack.pop()] = arr[i];
                }
            } else if (arr[i].equals("h")) {
                stack.push(i);
            }
        }

        return arr;
    }
}
